    false,nt"url": null,nt"notes": "Moorings were deployed from summer 2005
    to summer 2006. Each data file contains the data from one instrument-year. The listed
    year is the year in which the mooring was deployed. Moorings A2 and A3 were equipped
    with an upward-looking sonar (PI: Moritz, UW), but these data are not included in
    this archive. The Sea-Bird instrument at Mooring A2 (indicated as wOptical in the
    following list) was equipped with optical sensors for fluorescence, turbidity and
    PAR (Photosynthetically Active Radiation) (PI: Whitledge, UAF). These data are included
    in this archive, although only minimal quality control of the data has been performed,
    as noted in the header files. This leaves to the user final judgments about which
    portions of the optical records are usable. Very basic tests suggest the PAR data
    is likely unusable. The A2 Mooring was also equipped with NAS-2E nitrate analyzer
    (PI: Whitledge, UAF), but these data are not included in this archive.",nt"owner_org":
